import Link from 'next/link';
import Nav from './Nav';

export default () => (
  <div>
    <div className="bar">
      <Link href="/">
        <a>site_name</a>
      </Link>
      <Nav />
    </div>
    <div className="sub-bar">
      <p>Search</p>
    </div>
    <div>Cart</div>
  </div>
);
